        return(
            <Dropdown id="Dropdown"  toggle={toggle}>
                <DropdownToggle caret>
                  AND
                </DropdownToggle>
                <DropdownMenu>
                  <DropdownItem> AND </DropdownItem>
                  <DropdownItem> OR </DropdownItem>
                </DropdownMenu>
            </Dropdown>
        )

}

